import React , {Component} from 'react'
import { StyleSheet, Text, View , Image } from 'react-native'
import HeaderInfo from "../../components/HeaderInfo"



  class Home extends Component{

    render(){
    return (
        <View style={styles.container}>
          <View style={styles.wrapper}>
            <HeaderInfo />
              <View style={styles.promo}>
                <Image source={require('./Banner.png')} style={{width :380 , height : 100}} />
              </View>

            <Text style={styles.main}>Ayo <Text style={styles.maintext}>Main Futsal</Text></Text>

            
          </View>
        </View>
    )
  }
}

export default Home

const styles = StyleSheet.create({
  container : {
    flex : 1 ,
    backgroundColor : '#fff2ff' 
  } ,
  wrapper : {
    paddingHorizontal : 30 ,
    paddingTop : 30 
  } ,
  promo : {
    display : 'flex',
    flexDirection : 'row' ,
    marginTop : 20 ,
    marginLeft : 0 ,
    justifyContent : 'center'

  } , 
  main : {
    marginTop : 15 
  } ,

  maintext : {
    fontWeight : 'bold' ,
    fontSize : 18 ,
    
  }
})
